import React from 'react'
import './Square.css'
function changeBox (e) {
    e.target.style.background  = (e.target.style.background === 'blue') ? 'white' : 'blue'  
}
function Square({row, column, id}) {
    return (
        <div onMouseOver={changeBox} id = {id}>
            `row`
        </div>
    )
}

export default Square
